import React from 'react'
import '../styles/Header.css'
function Header() {

  // window.addEventListener('scroll', () => {


  //   const header = document.getElementsById('main-header')
  //   const scrollPos = window.scrollY;
  //   if (scrollPos > 10) {
  //     header.classList.add('scrolled')

  //   } else {
  //     header.classList.remove('scrolled')

  //   }
  // })
  return (
    <header className="main-header" id="main-header">
      <div className="logo">
        <a href="#">
          <img src="/images/media_16275151701056725651.jpg" alt="" srcSet="" />
        </a>
      </div>
      <label htmlFor="searchControl" className="fas fa-search nond"> ...</label>
      <input type="checkbox" className="nond" name="searchControl" id="searchControl" />
      <div id="inputHolder">
        <i id="iconSearch" className="fas fa-search"></i><input type="search" list="countryCarrd"
          placeholder="search  an item..." name="" id="inputField" />
      </div>

      <input type="checkbox" id="menu-btn" className="menu-btn" />
      <label htmlFor="menu-btn" className="menu-icon">
        <span className="menu-icon__line"></span>
      </label>


      <ul className="nav-links" id="nav-links">

        <li className="nav-link">
          <a href="shop.html">Shop</a>
        </li>



        <li className="nav-link">
          <a href="#">About</a>
        </li>

        <li className="nav-link">
          <a href="/cart.html"><i className="fas fa-shopping-cart fa-1x"></i> <span>cart</span></a>
        </li>
        <li className="nav-link signInBtn" id="account">
          <a className="accountlink" href="#"> Login </a>
        </li>

      </ul>


    </header>
  )
}

export default Header
